import React from 'react';
import { FaFacebookF, FaTwitter, FaInstagram, FaLinkedinIn } from 'react-icons/fa'
const Home = () => {
  return (
    <div className="relative">
      {/* Top bar */}
      <div className="bg-red-600 text-white text-center py-2 text-sm">
        Free Delivery on all orders Over $50
      </div>

      {/* Navbar */}
      <nav className="relative bg-black flex items-center justify-between px-8 py-4 text-white">
        <div className="flex items-center">
          {/* Logo */}
          <div className="text-3xl font-bold">PIZZAN</div>
        </div>
        <ul className="flex space-x-8 text-lg font-medium">
          <li><a href="#home" className="hover:text-red-600">Home</a></li>
          <li><a href="#menu" className="hover:text-red-600">Menu</a></li>
          <li><a href="#shop" className="hover:text-red-600">Shop</a></li>
          <li><a href="#pages" className="hover:text-red-600">Pages</a></li>
          <li><a href="#news" className="hover:text-red-600">News</a></li>
          <li><a href="#contact" className="hover:text-red-600">Contact Us</a></li>
        </ul>
        <div className="flex items-center space-x-6">
          <FaSearch className="text-2xl cursor-pointer hover:text-yellow-500" />
          <FaShoppingCart className="text-2xl cursor-pointer hover:text-yellow-500" />
          <button className="bg-red-600 text-white px-4 py-2 rounded-md font-semibold hover:bg-red-700">
            BOOK A TABLE
          </button>
        </div>
      </nav>

      {/* Main section */}
      <div className="relative bg-cover bg-center bg-[url('https://example.com/pizza-bg.jpg')] h-screen flex items-center">
        {/* Overlay */}
        <div className="absolute inset-0 bg-black bg-opacity-50"></div>

        {/* Text content */}
        <div className="relative z-10 px-8 text-white max-w-lg">
          <h1 className="text-5xl font-bold mb-4">GET BEST QUALITY FOOD FROM US</h1>
          <button className="bg-red-600 text-white px-6 py-3 rounded-md font-semibold hover:bg-red-700">
            EXPLORE MENU
          </button>
        </div>

        {/* Floating Food Illustration */}
        <div className="relative z-10 ml-auto">
          {/* Add your food illustration image or element here */}
          <img src="https://example.com/food-illustration.png" alt="Pizza Illustration" className="h-96" />
        </div>
      </div>
    </div>
  );
};

export default Home;
